        private void canvasMouseMove(jQueryEvent queryEvent)
        {
            queryEvent.PreventDefault();
            Document.Body.Style.Cursor = "default";
            lastMouseMove = queryEvent;
            if (sonicManager.UIManager.OnMouseMove(queryEvent)) return;

            return;
        }

